(function(global){

	"use strict";

	function User(model, auction) {
		var ref = User.current.ref;
		this.auction = auction;
		this.model = model || {};
		this.current = ref ? ref.model.id === this.model.id : true;
	}

	User.sessionKey = "user.current";

	User.prototype.withDefaults = function() {

